import React, { useState } from "react";

class Quote extends Component {
  render(){
    const [quote,setQuote]=useState("Work is not always pleasant")
    let author="Murial Anindo"
    return (
        <div>
            <p>"{quote}"</p>
            <p>- {author}</p>
            <button onClick={()=> setQuote("The question isn't who is working anymore.")}>Change Quote</button>
        </div>
    )
  }

}


export default Quote;
